import { makeStyles } from '@mui/styles';

export default makeStyles((theme) => ({
  container: {
    height: '500px', 
    width: '90%', 
    position: 'relative', 
    overflow: 'hidden', 
    marginTop: '90px',
    background:'red'
  },
  sidebar: {
    height: '100%',
    width: '35%',
    position: 'absolute',
    left: '0',
    transition: 'transform 0.5s ease-in-out'
  },
  sideBarDiv: {
    height: '100%',
    width: '100%',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    color: '#fff',
  },
  mainSlide: {
    height: '100%',
    position: 'absolute',
    top: '0',
    left: '35%',
    width: '65%',
    transition: 'transform 0.5s ease-in-out',
  },
  mainSlideDiv: {
    height: '100%',
    width: '100%',
  }
}))
